const Example = () => {

  return (
    <>
      <p style={{ textAlign: "center" }}>
        startフォルダの内容が表示されます。
        <br />
        練習用に使ってください！
      </p>

      <label><input></input>
        Apple</label>
    </>
  );
};

export default Example;
